pragma solidity ^0.4.4;


contract SmartCarStorage {

  struct CarInfo {
    string owner_name;
    uint owner_Id;
    uint previous_owner_Id;
    string car_description;
    uint timestamp;
    string secret;
  }

  mapping(uint=>CarInfo) Trail;

  uint8 trailCount = 0;

  function addCarInfo(string _ownerName, uint _ownerId, string _carDesc, string _secret) public {

    CarInfo memory newCarInfo;
    newCarInfo.owner_name = _ownerName;
    newCarInfo.owner_Id = _ownerId;
    newCarInfo.car_description = _carDesc;
    newCarInfo.secret = _secret;
    newCarInfo.timestamp = now;

    if(trailCount != 0) {
      newCarInfo.previous_owner_Id = Trail[trailCount].owner_Id;
    }

    trailCount++;

  }

  function getTrailCount() public returns(uint8) {
    return trailCount;
  }

  /**
    * @return owner_name
    * @return owner_id
    * @return previous_owner_id
    * @return timestamp
    * @return secret
   */
  function getCarInfo() public returns (string, uint, uint, uint, string) {
    return (Trail[trailCount].owner_name, Trail[trailCount].owner_Id, Trail[trailCount].previous_owner_Id, 
              Trail[trailCount].timestamp, Trail[trailCount].secret);
  }

}
